import React from 'react';
import ticketList from './ticketList.json';

function Tickets () {
    const tick = ticketList.tickets;
    console.log(tick)
    for (let i = 0; i < tick.length; i++) {
        for (let j = i; j < tick.length; j++){
            if (tick[i] > tick[j]){
                let temp = tick[i];
                tick[i] = tick[j];
                tick[j] = temp;
            }
            console.log(tick);
        }
    }

    return(
        <ul>
            {tick.map(item => (
                <li key={item.price}>
                    {item.origin}
                    {item.origin_name}
                    {item.destination}
                    {item.destination_name}
                    {item.departure_date}
                    {item.departure_time}
                    {item.arrival_date}
                    {item.arrival_time}
                    {item.carrier}
                    {item.stops}
                    <div>{item.price}</div>
                </li>
            ))}
        </ul>
    )
}

export default Tickets;
